This month I started a note on my phone called “January moments of joy”
Everyday before bed I open it and reflect on my day and write down one or many moments in my day that brought me joy. I’ve been journaling for many many years and it’s always something that allowed me to reflect and better myself. September to December was a challenging few months for me and I ended the year defeated, I  plan on not letting my mental health get that low again. 
Will I have challenging moments ? Of course but il keep doing my best to prioritize my mental health. 
I matter 🤍

