G R O U N D I N G 🌱 

Welcome to day one of #Alofusaregems today we have Tourmaline : grounded pose
This Gem is Indeed known for grounding purposes, stabilization , and to reaffirm our Earth roots. We can also use it to help Relieve stressful thoughts, and to clear insecurities and intense emotions. 

There is so many poses to me that allow me to feel grounded but at this moment a hip opener was also a great way to feel grounded and allow myself to release negative emotions that we’re holding me back. 

I’ve been releasing what no longer serve me to allow myself to make space for new things. Because I am worthy I no longer allow people to take that away from me. 

1. Tourmaline : grounded pose 🌱
2. Amethyst: balance pose
3. Citrine happiness pose that brings you joy
4. Ruby: love heart opener
5. Emerald : your money shot 😆 go to pose
6. Aquamarine : pose that reminds you of the sea
7. Topaz: pose that makes you feel powerful 
8. Your gem of choice: maybe even share your birthstone and pose to interpret

